script:
reset();

const size = 112;
const maxTerrainHeight = 8;
const maxHeight = 80;
const origin = { x: size * -0.5, z: size * -0.5 };
// const seed = Math.floor(Math.random() * (2 ** 32));
// console.log(`seed: ${seed}`);
const seed = 897580047;
const simplex = new SimplexNoise(seed);

const well = {
  origin: {
    x: -1,
    y: 0,
    z: -1,
  },
  radius: 38,
  height: 69,
};
const platform = {
  origin: {
    x: -5,
    y: 0,
    z: -5,
  },
  size: {
    x: 10,
    y: 6,
    z: 10,
  },
  tower: 40,
};
const rocket = {
  origin: {
    x: -1,
    y: 51,
    z: -45,
  },
  radius: 10,
  height: 14,
};

const map = new Uint8Array(size * maxHeight * size);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    map[x * size * maxHeight + y * size + z] = 2;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

const terrainY = 60;
const center = size * 0.5 - 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight + 10; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const sd = (center - x) ** 2 + (center - z) ** 2;
      const top = Math.min(size * Math.exp(
        -(sd) / ((size - 16) * 12)
      ), size * 0.5 - Math.sqrt(sd));
      const height = 10 + Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * top
      );
      map[x * size * maxHeight + (terrainY - 10 + y) * size + z] = y < height ? 1 : 0;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (y < terrainY - 10) {
        update(origin.x + x, y, origin.z + z, 9);
        continue;
      }
      if (map[x * size * maxHeight + y * size + z] === 1) {
        const top = (
          (
            Math.sqrt(
              ((origin.x + x) - well.origin.x - 0.5) ** 2
              + ((origin.z + z) - well.origin.z - 0.5) ** 2
			) > well.radius
          ) && (
            y === (maxHeight - 1)
            || !map[
              x * size * maxHeight + (y + 1) * size + z
            ]
          )
        );
        const type = top ? 1 : 4;
        if (top && y > 2 && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, 5);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 8);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

// Well
cylinder(
  well.origin.x, well.origin.y, well.origin.z,
  'y', well.radius, well.height, (x, y, z) => {
    let radius = well.radius - 2;
    if (y >= 64) {
      return 0;
    } else if (y > 55) {
      radius += simplex.noise3D(y / 8, x / 4, z / 8) * 2;
    } else if (y > 50) {
      radius = well.radius - 2;
    } else if (y >= 40) {
      radius = well.radius - 5;
    } else if (y > 5) {
      radius -= Math.floor((y + 3) / 8) * 2;
    }
    return Math.sqrt(
      (x - well.origin.x - 0.5) ** 2
      + (z - well.origin.z - 0.5) ** 2
    ) > radius ? 6 : 0;
  }
);

// Rocket
cylinder(
  rocket.origin.x,
  rocket.origin.y,
  rocket.origin.z,
  'y',
  rocket.radius,
  rocket.height,
  6
);
cylinder(
  rocket.origin.x,
  rocket.origin.y + 1,
  rocket.origin.z + 2,
  'y',
  rocket.radius - 2,
  rocket.height * 2,
  0
);

// Mid platform
box(
  platform.origin.x,
  platform.origin.y + platform.size.y - 1,
  platform.origin.z,
  platform.size.x, 1, platform.size.z,
  7
);
box(
  platform.origin.x + 1,
  platform.origin.y,
  platform.origin.z + 1,
  platform.size.x - 2,
  platform.size.y,
  platform.size.z - 2,
  6
);
cylinder(
  platform.origin.x + platform.size.x * 0.5 - 1,
  platform.origin.y + platform.size.y + platform.tower - 1,
  platform.origin.z + platform.size.z * 0.5 - 1,
  'y', platform.size.x * 0.75, 1, 6
);
cylinder(
  platform.origin.x + platform.size.x * 0.5 - 1,
  platform.origin.y + platform.size.y + platform.tower - 1,
  platform.origin.z + platform.size.z * 0.5 - 1,
  'y', platform.size.x * 0.75 - 2, 1, 8
);
cylinder(
  platform.origin.x + platform.size.x * 0.5 - 1,
  platform.origin.y + platform.size.y + platform.tower - 1,
  platform.origin.z + platform.size.z * 0.5 - 1,
  'y', 2, 1, 0
);
cylinder(
  platform.origin.x + platform.size.x * 0.5 - 1,
  platform.origin.y + platform.size.y + platform.tower,
  platform.origin.z + platform.size.z * 0.5 - 1,
  'y', platform.size.x * 0.75, 1, 7
);
cylinder(
  platform.origin.x + platform.size.x * 0.5 - 1,
  platform.origin.y + platform.size.y + platform.tower,
  platform.origin.z + platform.size.z * 0.5 - 1,
  'y', platform.size.x * 0.75 - 1, 1, 0
);
[
  { x: -2, z: -2 },
  { x: -2, z: 1 },
  { x: 1, z: 1 },
  { x: 1, z: -2 },
].forEach(({ x, z }) => {
box(
  platform.origin.x + platform.size.x * 0.5 + x,
  platform.origin.y + platform.size.y,
  platform.origin.z + platform.size.z * 0.5 + z,
  1, platform.tower, 1,
  7
);
});

// Lava
cylinder(
  well.origin.x, well.origin.y, well.origin.z,
  'y', well.radius, 1, 10
);

const elevators = [
  {
    x: 38,
    y: 7,
    z: -4,
    r: 0
  },
  {
    x: -46,
    y: 7,
    z: -4,
    r: 1
  }
];
elevators.forEach(({ x, y, z, r }) => {
  box(
    x + (r === 0 ? -4 : 8), y, z + 1,
    4, 6, 6,
    0
  );
  box(
    x + (r === 0 ? 0 : 7), y - 1, z + 1,
    1, 7, 6,
    6
  );
  box(
    x + 2, y, z + 2,
    4, 5, 4,
    0
  );
  for (let i = 0; i < 2; i += 1) {
    update(x + 3 + (r === 0 ? 1 : 0), y + 5, z + 2 + i * 3, 10);
  }
  box(
    x + (r === 0 ? -1 : 8), y, z + 2,
    1, 5, 4,
    7
  );
  box(
    x + (r === 0 ? -1 : 6), y, z + 3,
    3, 4, 2,
    0
  );
  box(
    x + (r === 0 ? -5 : 12), y - 1, z + 1,
    1, 1, 6,
    7
  );
});
